import React from "react";    //use component
import DeleteIcon from '@material-ui/icons/Delete';

const ListCom = (props) => {
    return (
        <div className="todo_style">
        <span>
            <DeleteIcon/>
        </span>
        <li> {props.text} </li>    
        </div>
    )};


export default ListCom;
